function Content(props){
    return(
        <div>
            <div classname="leftchar">
                <h2>{props.firstChar.name}</h2>
            </div>
            <div classname="rightchar">
                <h2>{props.secondChar.name}</h2>
            </div>
        </div>
        
    )
}

export default Content
